  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of this initiative is to develop
  a digital data base that contains all available bathymetric data north of 64 degrees
  North, for use by mapmakers, researchers, and others whose work requires a detailed
  and accurate knowledge of the depth and the shape of the Arctic seabed. Initiated
  in 1997, this undertaking has so far engaged the volunteer efforts of investigators
  who are affiliated with eleven institutions in eight countries: Canada, Denmark,
  Germany, Iceland, Norway, Russia, Sweden, and the USA. The activity has also been
  endorsed and/or supported financially by the Intergovernmental Oceanographic Commission
  (IOC), the International Arctic Science Committee (IASC), the International Hydrographic
  Organization (IHO), the US Office of Naval Research (ONR), and the US National Geophysical
  Data Center (NGDC). Version 2.23 of the IBCAO Grid is now available for downloading
  along with maps that are suitable for plotting. This new update is the most comprehensive
  since the first release of IBCAO in 2000 and includes the recent years of multibeam
  mapping. The resolution of the Polarstereographic grid has been increased from 2.5
  km to 2 km.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
